import { Box, Flex, Heading, Select, Text, DatePicker, Input } from "@chakra-ui/react";
import NavBar from "../../components/Navigasi";
import Footer from "../../components/Footer";


const Home = () => {
    
    return(
        <>
        
            <Box bgColor={"#F5F7FA"} bgSize={"cover"} paddingTop={"100px"} height={"100vh"}>
                <Heading>Sales Information</Heading>

                <Flex padding={"30px"} gap={10}>
                    <Box width={"190px"}>
                        <Text marginBottom={"15px"}>Customer</Text>
                        <Select variant={"outline"} placeholder="Name"></Select>
                    </Box>

                    <Box width={"190px"}>
                        <Text marginBottom={"15px"}>Date</Text>
                        <Input type="date" placeholder="Date"></Input>
                    </Box>

                    <Box width={"190px"}>
                        <Text marginBottom={"15px"}>Status</Text>
                        <Select variant={"outline"} placeholder="Status"></Select>
                    </Box>
                </Flex>


            </Box>   
        <Footer/> 
        </>
    )
};

export default Home;
